initialState.selectetTitleByDialogues = initialState.dialogues[0];

const dialoguesReducer = (state = initialState, action) => {
  switch (action.type) {
    case 'SELECTED_DIALOGUES_CHANGED': {
      const newState = { ...state };
      newState.selectetTitleByDialogues = 
          newState.dialogues.find(
              dialogue => dialogue.id === action.dialogueId
          );

      return newState;
    }
    default:
      return state;
  }
}

export default dialoguesReducer;